import React, { useState, useEffect } from 'react';

const Rocket = ({ activeSection, isMoving }) => {
  const [rocketPosition, setRocketPosition] = useState({ x: 0, y: 0 });
  const [isVisible, setIsVisible] = useState(false);

  // Calculate dynamic section positions based on viewport
  const calculateSectionPosition = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (!element) return { x: 20, y: 20 };
    
    const rect = element.getBoundingClientRect();
    const viewportHeight = window.innerHeight;
    const viewportWidth = window.innerWidth;
    
    // Position rocket on the left side, vertically centered with the section
    const x = 5; // 5% from left edge
    const y = ((rect.top + rect.height / 2) / viewportHeight) * 100;
    
    return { x: Math.max(5, Math.min(95, x)), y: Math.max(10, Math.min(90, y)) };
  };

  useEffect(() => {
    if (activeSection) {
      setIsVisible(true);
      const position = calculateSectionPosition(activeSection);
      setRocketPosition(position);
    }
  }, [activeSection]);

  // Update position on scroll for smooth following
  useEffect(() => {
    const handleScroll = () => {
      if (activeSection && !isMoving) {
        const position = calculateSectionPosition(activeSection);
        setRocketPosition(position);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, [activeSection, isMoving]);

  return (
    <div className="fixed top-0 left-0 w-full h-full pointer-events-none z-40">
      <div 
        className={`absolute transition-all duration-1000 ease-in-out ${isMoving ? 'animate-rocket-move' : ''}`}
        style={{
          left: `${rocketPosition.x}%`,
          top: `${rocketPosition.y}%`,
          transform: 'translate(-50%, -50%)',
          opacity: isVisible ? 1 : 0
        }}
      >
        {/* Rocket SVG */}
        <div className="relative">
          {/* Enhanced Rocket Trail */}
          <div className="absolute -bottom-12 left-1/2 transform -translate-x-1/2">
            <div className="w-2 h-20 bg-gradient-to-t from-orange-600 via-yellow-400 to-transparent opacity-90 animate-rocket-trail"></div>
            <div className="absolute -bottom-3 left-1/2 transform -translate-x-1/2 w-3 h-3 bg-orange-400 rounded-full animate-pulse"></div>
            <div className="absolute -bottom-6 left-1/2 transform -translate-x-1/2 w-1 h-1 bg-yellow-300 rounded-full animate-ping"></div>
          </div>
          
          {/* Main Rocket Body */}
          <svg 
            width="50" 
            height="70" 
            viewBox="0 0 50 70" 
            className="drop-shadow-2xl animate-rocket-hover"
          >
            {/* Rocket Body */}
            <ellipse 
              cx="25" 
              cy="50" 
              rx="10" 
              ry="15" 
              fill="#3B82F6" 
              className="animate-rocket-glow"
            />
            
            {/* Rocket Nose */}
            <path 
              d="M25 8 L15 30 L35 30 Z" 
              fill="#60A5FA" 
              className="animate-rocket-glow"
            />
            
            {/* Rocket Fins */}
            <path 
              d="M15 50 L10 65 L15 58 Z" 
              fill="#1E40AF" 
            />
            <path 
              d="M35 50 L40 65 L35 58 Z" 
              fill="#1E40AF" 
            />
            
            {/* Rocket Window */}
            <circle 
              cx="25" 
              cy="40" 
              r="4" 
              fill="#E0F2FE" 
              className="animate-pulse"
            />
            <circle 
              cx="25" 
              cy="40" 
              r="2" 
              fill="#0EA5E9" 
              className="animate-pulse"
            />
            
            {/* Rocket Details */}
            <rect 
              x="22" 
              y="35" 
              width="6" 
              height="2" 
              fill="#1E40AF" 
              rx="1"
            />
            <rect 
              x="22" 
              y="45" 
              width="6" 
              height="2" 
              fill="#1E40AF" 
              rx="1"
            />
            
            {/* Rocket Lights */}
            <circle 
              cx="20" 
              cy="25" 
              r="1" 
              fill="#FEF3C7" 
              className="animate-pulse"
            />
            <circle 
              cx="30" 
              cy="25" 
              r="1" 
              fill="#FEF3C7" 
              className="animate-pulse"
            />
          </svg>
          
          {/* Enhanced Sparkles around rocket */}
          <div className="absolute -top-3 -right-3 w-2 h-2 bg-yellow-300 rounded-full animate-sparkle"></div>
          <div className="absolute -top-2 -left-4 w-1 h-1 bg-blue-300 rounded-full animate-sparkle" style={{animationDelay: '0.5s'}}></div>
          <div className="absolute top-3 -right-5 w-1 h-1 bg-purple-300 rounded-full animate-sparkle" style={{animationDelay: '1s'}}></div>
          <div className="absolute -bottom-2 -left-2 w-1 h-1 bg-green-300 rounded-full animate-sparkle" style={{animationDelay: '1.5s'}}></div>
          
          {/* Moving particles */}
          <div className="absolute top-1/2 -left-8 w-1 h-1 bg-white rounded-full animate-ping opacity-60"></div>
          <div className="absolute top-1/3 -right-6 w-1 h-1 bg-blue-200 rounded-full animate-ping opacity-50" style={{animationDelay: '0.3s'}}></div>
        </div>
      </div>
    </div>
  );
};

export default Rocket;
